  <BannerContainer>
    <BannerTextBackgroundRed>
    <BannerText>Get a Free Stereo Wav Master &</BannerText>
    </BannerTextBackgroundRed>
    <BannerTextBackgroundYellow>
      <BannerText>Download Rates Today!</BannerText>
      <CustomButton>Send Audio</CustomButton>
    </BannerTextBackgroundYellow>
    <BannerTextBackgroundGreen>
      <BannerText>Book to<br/>Lock in Rates!</BannerText>
      <CustomButton>Book</CustomButton>
    </BannerTextBackgroundGreen>
  </BannerContainer>

);

